        "GettingStarted": {
            "title": "GettingStarted",
            "text": "\\define lingo-base() $:/language/ControlPanel/Basics/\nVitajte v ~TiddlyWiki a v ~TiddlyWiki komunite\n\nSkôr ako začnete ~TiddlyWiki  plniť dôležitými informáciami, uistite sa, že jeho obsah dokážete uložiť. Viď podrobnosti na  https://tiddlywiki.com/#GettingStarted\n\n!! Nakonfigurujte si tento ~TiddlyWiki\n\n<div class=\"tc-control-panel\">\n\n|<$link to=\"$:/SiteTitle\"><<lingo Title/Prompt>></$link> |<$edit-text tiddler=\"$:/SiteTitle\" default=\"\" tag=\"input\"/> |\n|<$link to=\"$:/SiteSubtitle\"><<lingo Subtitle/Prompt>></$link> |<$edit-text tiddler=\"$:/SiteSubtitle\" default=\"\" tag=\"input\"/> |\n|<$link to=\"$:/DefaultTiddlers\"><<lingo DefaultTiddlers/Prompt>></$link> |<<lingo DefaultTiddlers/TopHint>><br> <$edit-text tag=\"textarea\" tiddler=\"$:/DefaultTiddlers\"/><br>//<<lingo DefaultTiddlers/BottomHint>>// |\n</div>\n\nPre viac možností vyskúšajte [[control panel|$:/ControlPanel]].\n"
        },
        "$:/language/Help/build": {
            "title": "$:/language/Help/build",
            "description": "Automaticky spusti nakonfigurované príkazy",
            "text": "Vytvor špecifikované cieľové verzie pre aktuálny wiki. Ak nie sú špecifikované žiadne cieľové verzie, tak sa vytvoria všetky dostupné cieľové verzie.\n\n```\n--build <target> [<target> ...]\n```\n\nVytvor cieľe definované v súbore `tiddlywiki.info` wiki adresára.\n\n"
        },
        "$:/language/Help/clearpassword": {
            "title": "$:/language/Help/clearpassword",
            "description": "Zruš heslo pre následné šifrovacie operácie",
            "text": "Zruš heslo pre následné šifrovacie operácie\n\n```\n--clearpassword\n```\n"
        },
        "$:/language/Help/default": {
            "title": "$:/language/Help/default",
            "description": "",
            "text": "\\define commandTitle()\n$:/language/Help/$(command)$\n\\end\n```\nusage: tiddlywiki [<wikifolder>] [--<command> [<args>...]...]\n```\n\ndostupné príkazy:\n\n<ul>\n<$list filter=\"[commands[]sort[title]]\" variable=\"command\">\n<li><$link to=<<commandTitle>>><$macrocall $name=\"command\" $type=\"text/plain\" $output=\"text/plain\"/></$link>: <$transclude tiddler=<<commandTitle>> field=\"description\"/></li>\n</$list>\n</ul>\n\nDetailné vysvetlenie príkazu je možné dostať cez:\n\n```\ntiddlywiki --help <command>\n```\n"
        },
        "$:/language/Help/editions": {
            "title": "$:/language/Help/editions",
            "description": "Vylistovať názvy dostupných vydaní TiddlyWiki",
            "text": "Vylistovať názvy a popisy dostupných vydaní.  Môžete vytvoriť nový wiki zo špecifikovaného vydania pomocou príkazu `--init`.\n\n```\n--editions\n```\n"
        },
        "$:/language/Help/help": {
            "title": "$:/language/Help/help",
            "description": "Zobraz nápovedu pre TiddlyWiki príkazy",
            "text": "Zobrazí nápovedu pre príkaz:\n\n```\n--help [<command>]\n```\n\nAk sa vynechá názov príkazu, tak sa zobrazí zoznam všetkých existujúcich príkazov.\n"
        },
        "$:/language/Help/init": {
            "title": "$:/language/Help/init",
            "description": "Initializuj nový wiki adresár",
            "text": "Inicializuj prázdny [[WikiFolder|WikiFolders]] s kópiou špecifikovaného vydania.\n\n```\n--init <edition> [<edition> ...]\n```\n\nNapríklad:\n\n```\ntiddlywiki ./MyWikiFolder --init empty\n```\n\nPoznámka:\n\n* ak je to potrebné, vytvorí sa wiki adresár\n* \"Vydanie\" je štandardne ''empty''\n* ini príkaz zlyhá, ak wiki adresár nie je prázdny\n* init príkaz odstráni akékoľvek `includeWikis` definície definované v `tiddlywiki.info` súbore vydania\n* Ak sú špecifikované viaceré vydania, neskôr inicializované vydania prepíšu akékoľvek súbory zdieľané s predošlými vydaniami (čiže, ostatný `tiddlywiki.info` súbor sa prekopíruje z posledného vydania\n* `--editions` vráti zoznam dostupných vydaní\n"
        },
        "$:/language/Help/load": {
            "title": "$:/language/Help/load",
            "description": "Natiahni tiddlery zo súboru",
            "text": "Natiahni tiddlery z TiddlyWiki súborov vo verzii 2.x.x (`.html`), `.tiddler`, `.tid`, `.json` alebo iných súborov \n\n```\n--load <filepath>\n```\n\nAk chcete natiahnuť tiddlery zo zašifrovaného TiddlyWiki súboru, musíte najskôr zadať heslo cez PasswordCommand. Napríklad:\n\n```\ntiddlywiki ./MyWiki --password pa55w0rd --load moj_sifrovany_wiki.html\n```\n\nVšimnite si, že TiddlyWiki nenatiahne staršiu verziu už prítomného pluginu.\n"
        },
        "$:/language/Help/makelibrary": {
            "title": "$:/language/Help/makelibrary",
            "description": "Plugin zostrojenia knižnice potrebný pre proces upgradu",
            "text": "Vytvor `$:/UpgradeLibrary` tiddler pre proces upgradu.\n\nUpgrade knižnica má formát bežného pluginu s plugin typom `library`. Obsahuje kópiu každého pluginu, tém a jazykových balíkov dostupných v rámci  TiddlyWiki5 repozitára.\n\nTento príkaz je určený pre interné použitie; je relevantný len pre tých, čo vyrábajú vlastný, customizovaný postup pre upgrade.\n\n```\n--makelibrary <title>\n```\n\nArgument pre názov je pred-definovaný ako `$:/UpgradeLibrary`.\n"
        },
        "$:/language/Help/notfound": {
            "title": "$:/language/Help/notfound",
            "description": "",
            "text": "Žiadna taká položka v nápovede"
        },
        "$:/language/Help/output": {
            "title": "$:/language/Help/output",
            "description": "Definuje základný výstupný adresár pre každý následný príkaz.",
            "text": "Definuje základný výstupný adresár pre každý následný príkaz. Pred-definovaným adresárom je podadresár `output`  v adresári vydania.\n\n```\n--output <pathname>\n```\n\nAk je udaná cesta k súboru relatívna, tak sa resolvuje voči aktuálnemu adresáru,  s ktorým sa pracuje. Napríklad `--output .` argument nastaví výstup na aktuálne používaný adresár.\n\n"
        },
        "$:/language/Help/password": {
            "title": "$:/language/Help/password",
            "description": "Nastav heslo pre následné operácie šifrovania",
            "text": "Nastav heslo pre následné operácie šifrovania\n\n```\n--password <password>\n```\n\n"
        },
        "$:/language/Help/rendertiddler": {
            "title": "$:/language/Help/rendertiddler",
            "description": "Zobraz jednotlivý tiddler podľa špecifikovaného ContentType",
            "text": "Zobraz jednotlivý tiddler podľa špecifikovaného ContentType, štandardne zobrazujúc ako `text/html`, a ulož do určeného súboru:\n\n```\n--rendertiddler <title> <filename> [<type>]\n```\n\nŠtandardne sa názov súboru resolvuje voči `output` podadresáru v adresári vydania. Príkaz `--output` je možné použiť na presmerovanie výstupu do iného adresára.\n\nChýbajúce adresáre v ceste vytváraného súboru sa vytvoria automaticky.\n"
        },
        "$:/language/Help/rendertiddlers": {
            "title": "$:/language/Help/rendertiddlers",
            "description": "Zobraz tiddlery vyhovujúce filtru podľa určeného ContentType",
            "text": "Zobraz sadu tiddlerov vyhovujúcich filtru na odlíšenie určeného ContentType (štandardne ako `text/html`) a prípony (štandardne ako `.html`).\n\n```\n--rendertiddlers <filter> <template> <pathname> [<type>] [<extension>]\n```\n\nNapríklad:\n\n```\n--rendertiddlers [!is[system]] $:/core/templates/static.tiddler.html ./static text/plain\n```\n\nŠtandardne sa cesta k súboru resolvuje voči `output` podadresáru v adresári vydania. Príkaz `--output` je možné použiť na presmerovanie výstupu do iného adresára.\n\nVšetky súbory v cieľovom adresári sú vymazané. Ak cieľový adresár chýba, vytvorí sa rekurzívne.\n"
        },
        "$:/language/Help/savetiddler": {
            "title": "$:/language/Help/savetiddler",
            "description": "Uloží pôvodny obsah tiddlera do určeného súboru",
            "text": "Uloží jednotlivý tiddler v jeho pôvodnej textovej alebo binárnej podobe do určeného súboru. \n\n```\n--savetiddler <title> <filename>\n```\n\nŠtandardne sa cesta k súboru resolvuje voči `output` podadresáru v adresári vydania. Príkaz `--output` je možné použiť na presmerovanie výstupu do iného adresára.\n\nChýbajúce adresáre v ceste vytváraného súboru sa vytvoria automaticky.\n"
        },
        "$:/language/Help/savetiddlers": {
            "title": "$:/language/Help/savetiddlers",
            "description": "Uloží skupinu tiddlerov v ich pôvodnom formáte do určeného adresára",
            "text": "Uloží skupinu tiddlerov v ich pôvodnej textovej alebo binárnej podobe do určeného adresára. \n\n```\n--savetiddlers <filter> <pathname>\n```\n\nŠtandardne sa cesta k súboru resolvuje voči `output` podadresáru v adresári vydania. Príkaz `--output` je možné použiť na presmerovanie výstupu do iného adresára.\n\nChýbajúce adresáre v ceste vytváraného súboru sa vytvoria automaticky.\n"
        },
        "$:/language/Help/server": {
            "title": "$:/language/Help/server",
            "description": "Poskytuje interfejs HTTP servera pre TiddlyWiki",
            "text": "Server zabudovaný do TiddlyWiki5 je veľmi jednoduchý. Hoci je kompatibilný s TiddlyWeb, nemá mnohé z vlastností potrebné na robustné používanie z Internetu.\n\nNa úrovni roota slúži na zobrazenie určeného tiddlera. Mimo roota poskytuje jednotlivé tiddlery vo formáte JSON, a podporuje základné HTTP operácie ako `GET`, `PUT` a `DELETE`.\n\n```\n--server <port> <roottiddler> <rendertype> <servetype> <username> <password> <host> <pathprefix>\n```\n\nParametre sú:\n\n* ''port'' - port number (defaults to \"8080\")\n* ''roottiddler'' - tiddler slúžiaci ako root (štandardne \"$:/core/save/all\") \n* ''rendertype'' - typ obsahu, v ktorom sa má root tiddler zobrazovať (štandardne ako \"text/plain\")\n* ''servetype'' - typ obsahu, v ktorom má byť root tiddler poskytnutý (štandardne ako \"text/html\")\n* ''username'' - štandarne pred-definované meno používateľa na podpisovanie vykonaných zmien\n* ''password'' - voliteľné heslo pre základnú autentifikáciu\n* ''host'' - voliteľný hostname z ktorého sa poskytuje stránka (štandardne  \"127.0.0.1\" alebo \"localhost\")\n* ''pathprefix'' - voliteľný prefix pre cesty k súborom\n\nAk je špecifikovaný parameter hesla, tak browser vyzve používateľa na zadanie mena a hesla. Majte na pamäti, že heslo je posielané v nechránenej podobe, takže táto implentácia nie je vhodná na všeobecné použitie.\n\nNapríklad:\n\n```\n--server 8080 $:/core/save/all text/plain text/html MyUserName passw0rd\n```\n\nMeno a heslo musia byť zadané ako prázdne reťazce (v úvodzovkách), ak potrebujete nastaviť hostname alebo predponu pre cestu k súboru a nechcete vyžadovať heslo:\n\n```\n--server 8080 $:/core/save/all text/plain text/html \"\" \"\" 192.168.0.245\n```\n\nAk chcete spustiť viacero TiddlyWiki serverov naraz, musíte spustiť každý na inom porte.\n"
        },
        "$:/language/Help/setfield": {
            "title": "$:/language/Help/setfield",
            "description": "Pripraví na použitie externé tiddlery",
            "text": "//Majte na pamäti, že tento príkaz je experimentálny a vo finálnej verzii môže byť zmenený alebo nahradený//\n\nNastavuje určené pole skupiny tiddlerov na hodnotu výsledku do wiki prevedeného vzorového tiddlera s premennou `currentTiddler` pre daný tiddler.\n\n```\n--setfield <filter> <fieldname> <templatetitle> <rendertype>\n```\n\nParametre sú:\n\n* ''filter'' - filter špecifikujúci tiddlery, na ktoré sa má aplikovať\n* ''fieldname'' - pole, ktoré treba modifikovať (štandardne \"text\")\n* ''templatetitle'' - tiddler, ktorý treba vložiť vo wiki podobe do daného poľa. Ak neexistuje alebo je prázdny, tak sa špecifikované pole vymaže\n* ''rendertype'' - typ textu, ktorý treba renderovať (štandardne \"text/plain\"; je možné použiť \"text/html\" na zahrnutie  HTML štítkov)\n"
        },
        "$:/language/Help/unpackplugin": {
            "title": "$:/language/Help/unpackplugin",
            "description": "Rozbalí obsah plugin tiddlera",
            "text": "Vyextrahuje obsah plugin tiddlerov vytvoriac z nich bežné tiddlery:\n\n```\n--unpackplugin <title>\n```\n"
        },
