        "$:/language/Modals/Download": {
            "title": "$:/language/Modals/Download",
            "type": "text/vnd.tiddlywiki",
            "subtitle": "Download changes",
            "footer": "<$button message=\"tm-close-tiddler\">Close</$button>",
            "help": "https://tiddlywiki.com/static/DownloadingChanges.html",
            "text": "Bohužiuľ, Váš browser podporuje len manuálne uloženie wiki.\n\nAk chcete uložiť zmeny, nastavte sa na linku nižšie, stlačte pravé tlačítko na myši a vyberte \"Stiahnúť súbor\" alebo \"Uložiť súbor\", a potom zvoľte adresár a názov súboru.\n\n//Proces môžete trochu urýchliť tým, že kliknete na linku súčasne so stlačením klávesy control (Windows) alebo options/alt (Mac OS X). Vtedy vás systém už nevyzve na zadanie názvu adresára a súboru, ale je možné, že váš browser dá súboru náhodný a nezrozumiteľný názov -- a skôr ako budete so súborom môcť niečo robiť, musíte ho premenovať a dať mu príponu `.html`.//\n\nNa mobilných telefónoch, ktoré nedovolia sťahovať súbory, môžete namiesto toho vyrobiť pre súbor záložku a potom záložku zosynchronizovať s počítačom, na ktorom už wiki viete uložiť bežným spôsobom.\n"
        },
        "$:/language/Modals/SaveInstructions": {
            "title": "$:/language/Modals/SaveInstructions",
            "type": "text/vnd.tiddlywiki",
            "subtitle": "Save your work",
            "footer": "<$button message=\"tm-close-tiddler\">Close</$button>",
            "help": "https://tiddlywiki.com/static/SavingChanges.html",
            "text": "Vaše zmeny v tomto wiki treba uložiť ako ~TiddlyWiki HTML súbor.\n\n!!! PC browsery\n\n# Zvoľte si ''Uložiť ako'' z menu ''Súbor''\n# Zvoľte si meno súboru a miesto\n#* Pri niektorých browseroch sa vyžaduje presne definovať formát uloženia ako ''web stránka, len HTML'' alebo niečo podobné\n# Zatvorte túto záložku (tab)\n\n!!! Browsery v mobiloch\n\n# Vytvorte pre túto stránku bookmark \n#* Ak používate iCloud alebo Google Sync, tak sa bookmark automaticky zosynchronizuje s vaším PC, kde wiki súbor môžete otvoriť a uložiť\n# Zatvorte túto záložku (tab)\n\n//Ak bookmar znovu otvoríte v Mobile Safari, uvidíte túto hlášku znovu. Ak chcete rovno pokračovať a pracovať so súborom, tak len stlačte tlačítko ''zatvoriť'' nižšie//\n"
        },
